import Select from 'react-select'
import Track from './Track'

class Tracks extends React.Component
{
    render() {
        return (
            <div>
                <Select 
                    options={ this.props.data.tracks } 
                    getOptionLabel={(option)=>option.name}
                    getOptionValue={(option)=>option.id}
                    onSelect="loadTrack"
                />
                <div id="track-detail">
                    <Track />
                </div>
            </div>
        );
    }

